import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Menu,
  MenuItem,
} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

export default function Nav() {

  const [example, setExample] = useState("default");

  const onMenuClick = () => {
    console.log("hello")
  }

  return (
    // <nav>
    //   <NavLink exact to="/">
    //     Home
    //   </NavLink>
    //   &nbsp;|&nbsp;
    //   <NavLink to="/login">Login</NavLink>
    //   &nbsp;|&nbsp;  
    //   <NavLink to="/logout">Logout</NavLink>
    //   &nbsp;|&nbsp;  
    //   <NavLink to="/contact">Contacts</NavLink>
    //   <br></br>
    //   <hr></hr>
    // </nav>
    <AppBar>
      <Toolbar>
        <IconButton
          edge="start"
          color="inherit"
          aria-label="menu"
        >
          <MenuIcon />
        </IconButton>
        <Typography variant="h6">
          AppBar
        </Typography>
        <IconButton color="inherit" onClick={() => setExample("default")}>
          1
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("primary")}>
          2
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("secondary")}>
          3
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("transparent")}>
          4
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("customColor")}>
          5
        </IconButton>
        <IconButton
          onClick={() => setExample("customHeight")}
        >
          6
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
